import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <main className="px-5 ">
        <Header />
        <Routes>
          <div className="sm:flex sm:gap-10">
            <MainArticle />
            <NewContainer />
          </div>
          <ContainerArticleFoot />

        </Routes>
        <Footer />

      </main>

    </BrowserRouter>


  );
}

export default App;
